import Footer from "../components/Footer";
import HeaderIT from "../components/HeaderIT";
import Container from 'react-bootstrap/Container';
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';
import { CardImg } from "react-bootstrap";
import { CardBody } from "@chakra-ui/react";

function NewsIT() {
    return (
        <>
            <HeaderIT />
            <section id='news'>
                <Container>
                    <Card>
                        <CardImg variant="top" src={`${require('../images/news-2.jpeg')}`} />
                        <Card.Body>
                            <Card.Text>
                                Ristorante Galleria si aggiudica il prestigiosissimo riconoscimento di “Insegna storica e di tradizione” della Regione Lombardia
                            </Card.Text>
                        </Card.Body>
                    </Card>
                </Container>
            </section>
            <Footer />
        </>
    );
}

export default NewsIT;
